import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li className="navbar"><Link to="/">Home</Link></li>
          </ul>
        </nav>

      </div>
      <Switch>
        <Route exact path="/" />
      </Switch>
    </Router>
  );
}

export default App;
